import React, {useState} from 'react'
// import styles from "./styles"
import * as s from './Navbar.elements'
import { FaBars, FaTimes} from 'react-icons/fa'
import { IconContext } from 'react-icons/lib'
import {Button} from '../../globalStyles'

// import logo from "../../img/logo.png"

export function Navbar() {
    const [click, setClick] = useState(false);
    const [button, setButton] = useState(true);

    const handleClick = () => setClick(!click)

    return (

        <>
            <IconContext.Provider value={{color: '#fff'}}>
                <s.Nav>
                    <s.NavbarContainer>
                        <s.NavLogo to='/'>
                            <s.NavIcon />
                            SPACESHIP
                        </s.NavLogo>
                        <s.HamburgerMenu onClick={handleClick}>
                            {click ? <FaTimes /> : <FaBars />}
                        </s.HamburgerMenu>
                        <s.NavMenu onClick={handleClick} click={click}>
                            <s.NavItem>
                                <s.NavLinks to='/'>
                                    Home
                                </s.NavLinks>
                            </s.NavItem>
                            <s.NavItem>
                                <s.NavLinks to='/services'>
                                    Services
                                </s.NavLinks>
                            </s.NavItem>
                            <s.NavItem>
                                <s.NavLinks to='/products'>
                                    Products
                                </s.NavLinks>
                            </s.NavItem>
                            <s.NavItemBtn>
                                {button ? (
                                    <s.NavBtnLink to='/sign-up'>
                                        <Button orange>SIGN UP</Button>
                                    </s.NavBtnLink>
                                ) : (
                                    <s.NavBtnLink to='/sign-up'>
                                        <Button fontBig orange>SIGN UP</Button>
                                    </s.NavBtnLink>
                                )}
                            </s.NavItemBtn>
                        </s.NavMenu>
                    </s.NavbarContainer>
                </s.Nav>
            </IconContext.Provider>
        </>

        // <s.Container>
            // <s.NavbarStyle>
            //     <s.Logo src={logo} alt="something"/>
            //     <nav>
            //         <s.Menu>
            //             <li>About</li>
            //             <li>Gallery</li>
            //             <li>Pricing</li>
            //             <li>FAQ</li>
            //         </s.Menu>
            //     </nav>

            //         <div>
            //             <s.SignIn>Sign in</s.SignIn>
            //             <s.SignUp>Sign up</s.SignUp>
            //         </div>    

            // </s.NavbarStyle>
        // </s.Container>
    )
}
